    textCopy: '<div class="grid-layout"><div class="twocolumns"><div class="half"><div class="page-img student-centers"><img src="/img/hkn-logo.png"></img></div><div class="page-award">UCLA HKN</div><p></p><div class="page-text"><p>The UCLA Iota Gamma Chapter of Eta Kappa Nu (HKN) is the electrical and computer engineering honor society dedicated to encouraging excellence through scholarship, service, leadership, and character. The Iota Gamma Chapter currently has around 150 members and continues to grow. HKN aims to serve the ECE community under the guidance of Professor Benjamin Williams, providing tutoring and hosting various events throughout the year.</p><p> The events are split into technical events and social events. The technical events include a quarterly professor lunch, corporate infosessions, and our workshop series on MATLAB and Verilog. The social events ­include board game nights, movie nights, and KBBQ outings. One of the main events that HKN co-hosts with the IEEE branch is the annual ECE Department Town Hall, where students can provide feedback on the ­current curriculum.</p></div></div><div class="half"><div class="page-img student-centers"><img src="/img/hkn.png"></img><br></div><div style="margin-bottom:2em" class="spacer"><img src="/img/pixel.png"></div></div></div></div>'
