    textCopy: '<div class="grid-layout"><div class="twocolumns"><div class="half"><div class="page-award"></div><div class="page-img student-centers"></div><p></p><div class="page-img student-centers"><img src="/2020-2021/img/ieee1.jpg"></img><br></div><div style="margin-bottom:2em" class="spacer"><img src="/2020-2021/img/ieee2.jpg"></div><div style="margin-bottom:2em" class="spacer"><img src="/2020-2021/img/ieee3.jpg"></div><div style="margin-bottom:2em" class="spacer"><img src="/2020-2021/img/ieee4.jpg"></div><div class="page-text"></div></div><div class="half"><div class="page-award"></div><div class="page-text"><p> IEEE at UCLA is a professional student-run organization dedicated to providing a space where engineers of all backgrounds can come together, collaborate, and learn. Every year, IEEE at UCLA hosts over 100 events, encompassing technical lectures, community outreach, professional development, socials, industry workshops, and IDEA Hacks, one of the largest hardware hackathons in the nation. Additionally, we lead several projects for our members to participate in, where dedicated leads provide fundamental knowledge and skills to students to help them complete challenging and interesting projects.</p><p> Currently, members can choose between 5 diverse projects: <span>OPS, Micromouse, Aircopter, DAV,</span> and <span>WRAP.</span> Additionally, we hold workshops throughout the year that members are free to drop in on and attend.</p><p> Our OPS program is designed to provide hands-on foundational knowledge in the field of tech and hardware. We assume you know absolutely nothing, and build your knowledge from the ground up. Throughout the year, students will be challenged to complete 3-4 small projects per quarter by applying the skills they have learned.</p><p> A <span> micromouse</span> is a small robot that\'s programmed to find it\'s way to a goal within a maze. In this program, our leads teach you the fundamentals of how a micromouse is designed, and eventually you\'ll print your own PCB, solder a micromouse together, and program it through a maze. We hold annual events where students are invited to compete against each other with their micromouse.</p><p> Our <span>Aircopter </span>program is designed around a few projects that require more advanced topics that aren\'t covered in our beginning OPS program. Some of the subjects we emphasize in this program are communication, advanced control, motors, and common modules such as gyroscopes and radio modules to build a quadcopter.</p><p>The <span>Digital Audio Visualizer</span> project, or <span>DAV,</span> is designed to give students a new learning experience with hardware design for digital logic circuits. Students will build a real-life application of signal processing by using an FPGA to calculate Fourier Transforms from microphone audio, and displaying the frequency information on a monitor.</p><p> The <span>Wireless, RF, and Analog Project,</span> or <span>WRAP,</span> is an opportunity for students to dive into analog circuits and wireless communications, beyond what is covered in classes. Over the course of the school year, students will learn the fundamentals of analog and RF circuits, and digital communications. Using this knowledge, students will design, simulate, and fabricate from scratch their own wireless transmitter and receiver system.</p><p> IEEE also holds a series of workshops throughout the school year where anyone can participate and learn about new skills and technologies. These workshops are aimed at teaching everyone about common skills in electrical engineering such as soldering, image processing, prototyping, and electronics. For more information, please visit our website at <i>http://ieeebruins.com/. </i></p></div></div></div></div> '
